import { useState } from "react";

function SpawnVarModButton({
  incomingKey,
  incomingValues,
  incomingHandleVariableChanges,
}) {
  const [modalExist, setModalExist] = useState(false);

  function toggleModal() {
    setModalExist(!modalExist);
    
  }

  return (
    <>
      <button className="border-white text-white border rounded-[10px] p-[10px] hover:bg-black" onClick={toggleModal()}>
        Spawn Modal
      </button>
    </>
  );
}

export default SpawnVarModButton;
